	res,
	err
}) => {
	let statusCode = null
	if(res) {
		({
			statusCode
		} = res)
	} else if(err) {
		({
			statusCode
		} = err)
	}
	return {
		namespacesRequired: ['common'],
		statusCode,
	}
}

Page404.defaultProps = {
	statusCode: null,
}

Page404.propTypes = {
	statusCode: PropTypes.number,
